/* eslint-disable react/prop-types */
import React from 'react';
import { Route, Redirect } from 'react-router-dom';

import NavBar from './Navbar/Navbar';
import { getSession, handleUrl, checkUserValidity } from '../utils/authService';

const AuthRoute = ({
  component: C,
  props: cProps,
  pageNotFound: notFound,
  ...rest
}) => {
  let firstName = '';
  let lastName = '';
  const sessionData = getSession(cProps.sessionCookie);
  const { page } = cProps;
  console.log("page:", page);
  const fullName =
    (firstName && firstName.length > 0) || (lastName && lastName.length > 0)
      ? `${firstName} ${lastName}`
      : 'User';

  const authorizedComponent = 
    <>
      <Route
          {...rest}
          render={props => <C {...props} {...cProps} inProgress />}
        />
    </>

  return <>{handleUrl(authorizedComponent)}</>;
};
export default AuthRoute;
